import React from "react";
import ExpenseItems from "./Components/ExpenseItems";
import { expenses } from "./Expenseitemsdata";
import "./App.css";
const App = () => {
  return (
    <div className="App">
      <div className="Container">
        {expenses.map((item) => (
          <div>
            <ExpenseItems key={item.id} items={item} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default App;
